import LogoIcon from "./Components//LogoIcon.vue";
export default {
  data() {
    return {
      isCalling: false
    };
  },
  components: {
    LogoIcon
  },
  watch: {
    "taxiData.Executor.activeOrder": {
      handler() {
        setTimeout(() => {
          this.goToRoute();
        });
      },
      deep: true
    },
    "taxiData.Customer.step": {
      handler() {
        setTimeout(() => {
          this.goToRoute();
        });
      },
      deep: true
    }
  },
  computed: {
    taxiData() {
      return this.$store.getters["phone/getTaxiData"];
    }
  },
  methods: {
    goToRoute() {
      console.log("GO TO ROUTE");
      const bindRoute = {
        wait: "Waiting",
        main: "Main",
        ready: "Accepted",
        onOrder: "OnOrder",
        goToTheOrder: "GoToTheOrder"
      };
      if (this.taxiData.Executor.activeOrder) {
        this.$router.push(`/Phone/TaxiApp/${bindRoute[this.taxiData.Executor.activeOrder.step]}`);
      } else {
        this.$router.push(`/Phone/TaxiApp/${bindRoute[this.taxiData.Customer.step]}`);
      }
    }
  },
  mounted() {
    console.log("Mounted TaxiApp.vue");
    this.goToRoute();
  }
};
